%
%  PROGRAM
% kasymbol - Add a symbol annotation object to a kobject
%
%  DESCRIPTION
% This operator adds a symbol annotation object to a kobject (specified with the [-i] parameter), saving the object with the new annotation in the file specified with the [-o] parameter. All embedded objects in the input object will be copied to the output object, which data will not be modified until it is passed through the karender kroutine.
% The symbol object parameters are: an index for the symbol, passed with the [-symbol] parameter, its size, passed with the [-size] parameter, its center coordinates (passed with the [-x] and [-y] parameters), the frames where it will be drawn (passed with the [-d] and [-t] parameters) and its color ([-color] parameter) and opacity ([-opacity] parameter).
% The symbols shown in the GUI for this kroutine were rendered with size = 1. This default size defines a symbol inside a 21x21 pixel region, and multiple values of the size will generate symbols with the corresponding scale.
